t\":\"2021-05-13 12:03:47\",\"id\":28,\"images\":[],\"media\":[]}','162.158.227.168','2021-05-13 12:03:47','2021-05-13 12:03:47'),('870','created','29','App\\Models\\Product','2','{\"name\":\"Corn Flower Seed\",\"description\":\"GROWING METHOD OF CORNFLOWER:\\r\\nCornflower is grown by direct seed sowing in pots.\\r\\nSowing can be done in June-July in low rainfall regions and September-October for winter flowering.\\r\\nThe garden soil should be well prepared and formed evenly. Soil should be aerated, porous with good drainage.\\r\\nBefore sowing the seeds, soil should be made slightly moist.\\r\\nFor beds and borders, seeds can be broadcasted directly and evenly on the soil, and extra seedlings can be thinned later.\\r\\nImmediately after sowing the seeds, water carefully with a fine rose-can.\\r\\n\\r\\n\\r\\nPlanting Distance: 20-25 cm spacing allowed. The plant can be grown in a 10-inch pot.\\r\\n\\r\\nWatering: Regular light watering is recommended.\\r\\n\\r\\nFeeding: Fresh compost should be added to soil at the time of planting is given every 15 days along with vermicompost.\\r\\n\\r\\nPlant care: It is a hardy plant that does not attract many diseases. Allow the plant to grow freely in open sunny locations.\\r\\n\\r\\nBloom time: The plant flowers in 3 to 3.5 months.\\r\\n\\r\\nDeadheading: It is advisable to remove the faded for a prolonged flowering period.\",\"brand_id\":null,\"updated_at\":\"2021-05-13 12:08:56\",\"created_at\":\"2021-05-13 12:08:56\",\"id\":29,\"images\":[],\"media\":[]}','162.158.227.168','2021-05-13 12:08:56','2021-05-13 12:08:56'),('871','created','30','App\\Models\\Product','2','{\"name\":\"Cabbage Ornamental Flower Seeds\",\"description\":\"PLANT HEIGHT : Grows Up To 1.5 Feet High\\r\\n\\r\\nFLOWER SHAPE: Fringed, Ruffled Leaves\\r\\n\\r\\nCOLOUR : Pink, Purple And White With Green Edges\\r\\n\\r\\nSPECIFICATIONS : Edible Leaves, Suitable For Salad Dressings\",\"brand_id\":null,\"updated_at\":\"2021-05-13 12:10:18\",\"created_at\":\"2021-05-13 12:10:18\",\"id\":30,\"images\":[],\"media\":[]}','162.158.227.168','2021-05-13 12:10:18','2021-05-13 12:10:18'),('872','created','31','App\\Models\\Product','2','{\"name\":\"Carnation Flower Seeds\",\"description\":\"Growing Carnations\\r\\nCarnations grow readily from cuttings made from the suckers that form around the base of the stem, the side shoots of the flowering stem, or the main shoots before they show flower-buds.\\r\\nThe cuttings from the base make the best plants in most cases.\\r\\nThese cuttings may be taken from a plant at any time through fall or winter, rooted in sand and potted up.\\r\\nThey may be put in pots until the planting out time in spring, which is usually in April or in any time when the ground is ready to be handled.\\r\\nThe soil should be deep, friable and sandy loam.\",\"brand_id\":null,\"updated_at\":\"2021-05-13 12:11:29\",\"created_at\":\"2021-05-13 12:11:29\",\"id\":31,\"images\":[],\"media\":[]}','162.158.227.168','2021-05-13 12:11:29','2021-05-13 12:11:29'),('873','created','32','App\\Models\\Product','2','{\"name\":\"Shree Moong - Green Gram Seeds\",\"description\":\"Shree Moong Green Gram seeds , the variety is Kopergaon which is mostly preferred during kharif season .\\r\\n\\r\\nThis is one of the height yielding variety of Moon ( Green Gram )\\r\\n\\r\\nThe product offer here is 1 Kg  Pack , delivered to your address .\",\"brand_id\":null,\"updated_at\":\"2021-05-13 12:14:44\",\"created_at\":\"2021-05-13 12:14:44\",\"id\":32,\"images\":[],\"media\":[]}','162.158.227.168','2021-05-13 12:14:44','2021-05-13 12:14:44'),('874','created','33','App\\Models\\Product','2','{\"name\":\"Bengal Gram (Chana) - Seeds VIJAY\",\"description\":\"Crop     : Bengal Gram (Chana)\\r\\n\\r\\nVariety  : Vijay \\r\\n\\r\\nMaturity : 105-110 days\\r\\n\\r\\nFeatures : Resistant to Wilt , \\r\\n\\r\\n\\t   Tolerant to terminal moisture stress\\r\\n\\r\\nPacking available : 10 Kg\",\"brand_id\":null,\"updated_at\":\"2021-05-13 12:16:39