  CONSTRAINT `orders_transaction_id_foreign` FOREIGN KEY (`transaction_id`) REFERENCES `transactions` (`id`),
  CONSTRAINT `user_fk_2927119` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`)
