/*!40000 ALTER TABLE `product_categories` DISABLE KEYS */;
INSERT INTO `product_categories` VALUES ('1','Agri Equipments','Agricultural machinery relates to the mechanical structures and devices used in farming or other agriculture. There are many types of such equipment, from hand tools and power tools to tractors and the countless kinds of farm implements that they tow or operate. Diverse arrays of equipment are used in both organic and nonorganic farming. Especially since the advent of mechanized agriculture, agricultural machinery is an indispensable part of how the world is fed','2021-04-06 22:03:45','2021-04-06 22:03:45',NULL),('2','Pesticides','Pesticides are substances that are meant to control pests.[1] The term pesticide includes all of the following: herbicide, insecticides (which may include insect growth regulators, termiticides, etc.) nematicide, molluscicide, piscicide, avicide, rodenticide, bactericide, insect repellent, animal repellent, antimicrobial, and fungicide.[2] The most common of these are herbicides which account for approximately 80% of all pesticide use.[3] Most pesticides are intended to serve as plant protection products (also known as crop protection products), which in general, protect plants from weeds, fungi, or insects. As an example - The fungus Alternaria is used to combat the Aquatic weed, Salvinia','2021-04-06 22:04:46','2021-04-06 22:04:46',NULL),('3','Fertilizers','A fertilizer (American English) or fertiliser (British English; see spelling differences) is any material of natural or synthetic origin that is applied to soil or to plant tissues to supply plant nutrients. Fertilizers may be distinct from liming materials or other non-nutrient soil amendments. Many sources of fertilizer exist, both natural and industrially produced.[1] For most modern agricultural practices, fertilization focuses on three main macro nutrients: Nitrogen (N), Phosphorus (P), and Potassium (K) with occasional addition of supplements like rock dust for micronutrients. Farmers apply these fertilizers in a variety of ways: through dry or pelletized or liquid application processes, using large agricultural equipment or hand-tool methods','2021-04-06 22:05:43','2021-04-06 22:05:43',NULL),('4','Seeds','A seed is an embryonic plant enclosed in a protective outer covering. The formation of the seed is part of the process of reproduction in seed plants, the spermatophytes, including the gymnosperm and angiosperm plants','2021-04-06 22:06:37','2021-04-06 22:06:37',NULL),('5','Sprayers','A sprayer is a device used to spray a liquid, where sprayers are commonly used for projection of water, weed killers, crop performance materials, pest maintenance chemicals, as well as manufacturing and production line ingredients. In agriculture, a sprayer is a piece of equipment that is used to apply herbicides, pesticides, and fertilizers on agricultural crops. Sprayers range in size from man-portable units (typically backpacks with spray guns) to trailed sprayers that are connected to a tractor, to self-propelled units similar to tractors, with boom mounts of 4–30 feet up to 60–151 feet in length depending on engineering design for tractor and land size','2021-04-06 22:08:02','2021-04-06 22:08:02',NULL),('6','Organic Products','An organic product is made from materials produced by organic agriculture. There are different types of organic products. However organic product is more known for food items like organic grocery, organic vegetables, organic certified food etc. Most appropriately organic products can be explained as any products that is made or cultivated organically should be treated as an organic product. Most of the country has very strict food safety and security guidelines to protect consumers from consuming harmful products. Most of the country has its own standard to define products as organic. USA uses USDA certification - NOP National Organic Program to defined a cultivated products as organic. Indian Organic - NPOP (National Program for Organic Production). According to USDA, in order for a product to be considered organic, organic standards must be met. Operations involving these organic products must be \"protecting natural resources, conserving biodiversity, and using only approved substances.\"[1]\r\n\r\nTo be marketed as \"organic\" products require certification and must comply with certain guidelines. In the United States the National List of Allowed and Prohibited Substances details synthetic and non-synthetic substances that can be used in the process of producing organic products. This list involves specific substances that can be used to produce organic material involving crops and livestock','2021-04-06 22:09:08','2021-04-06 22:09:08',NULL),('7','Micronutrients','Micronutrients are essential elements that are used by plants in small quantities. For most micronutrients, crop uptake is less than one pound per acre. In spite of this low requirement, critical plant functions are limited if micronutrients are unavailable, resulting in plant abnormalities, reduced growth and lower yield. In such cases, expensive, high requirement crop inputs such as nitrogen and water may be wasted. Because of higher yields, higher commodity prices and higher costs of crop inputs, growers are reviewing all potential barriers to top grain production, including micronutrient deficiencies. This Crop Insights will discuss general micronutrient requirements, deficiency symptoms, soil and plant sampling, and fertilization practices. Future Crop Insights articles will discuss specific crops, their micronutrient or secondary nutrient requirements and management considerations.','2021-04-10 06:13:50','2021-04-10 06:13:50',NULL),('8','Nursery Garden','Nursery, place where plants are grown for transplanting, for use as stock for budding and grafting, or for sale. Commercial nurseries produce and distribute woody and herbaceous plants, including ornamental trees, shrubs, and bulb crops. While most nursery-grown plants are ornamental, the nursery business also includes fruit plants and certain perennial vegetables used in home gardens (e.g., asparagus, rhubarb). Some nurseries are kept for the propagation of native plants for ecological restoration. Greenhouses may be used for tender plants or to keep production going year round, but nurseries most commonly consist of shaded or exposed areas outside. Plants are commonly cultivated from seed or from cuttings and are often grown in pots or other temporary containers.','2021-04-10 06:26:52','2021-04-10 06:26:52',NULL),('9','Micronutrient Mixture','Micronutrient Mixture of zinc sulphate, copper sulphate, magnesium sulphate, manganese sulphate, boron, ferrous sulphate and amonium molybdate in perfect percentage and in scientific methrod , micronutrient is essential for all plants specific micro nutrients essential for avoiding and curing the micronutrinet deficiency, all micronutrient element are blended in perfect combination.','2021-04-10 08:20:47','2021-04-10 08:21:20','2021-04-10 08:21:20'),('10','New Category','test','2021-05-31 12:09:27','2021-05-31 12:30:18','2021-05-31 12:30:18'),('11','new category',NULL,'2021-05-31 12:31:31','2021-05-31 12:31:31',NULL),('12','New Category','Description','2021-06-02 13:18:25','2021-06-02 13:18:25',NULL),('13','Test Category',NULL,'2021-06-03 17:43:49','2021-06-03 17:43:49',NULL),('14','Test Category1',NULL,'2021-06-03 18:34:17','2021-06-03 18:34:17',NULL);
