INSERT INTO `product_sub_categories` VALUES ('1','Agri Tools','1','List of Modern Equipment and Farm Tools\r\nThe Monoculture. The tiller is a type of agricultural machinery of a single axis. ...\r\nShovel. This element made of tough and sharp sheet metal. ...\r\nWheelbarrow.\r\nThe Harvester.\r\nSprinkler.\r\nSeeder and fertilizer.\r\nBaler','2021-04-06 22:11:44','2021-04-06 22:11:44',NULL),('2','Bio Fertilizers','3','A biofertilizer (also bio-fertilizer) is a substance which contains living micro-organisms which, when applied to seeds, plant surfaces, or soil, colonize the rhizosphere or the interior of the plant and promotes growth by increasing the supply or availability of primary nutrients to the host plant.[1] Biofertilizers add nutrients through the natural processes of nitrogen fixation, solubilizing phosphorus, and stimulating plant growth through the synthesis of growth-promoting substances. The microorganisms in biofertilizers restore the soil\'s natural nutrient cycle and build soil organic matter. Through the use of biofertilizers, healthy plants can be grown, while enhancing the sustainability and the health of the soil. Biofertilizers can be expected to reduce the use of synthetic fertilizers and pesticides, but they are not yet able to replace their use. Since they play several roles, a preferred scientific term for such beneficial bacteria is \"plant-growth promoting rhizobacteria\" (PGPR).','2021-04-06 22:13:13','2021-04-06 22:13:27',NULL),('3','Agro Industry Equipment','1','The agricultural equipment or Implements or tools which are to be used in farming may be bigger one like carts, bullock driven ploughs, tractor driven plough, transplanter, tractor, harvester, fertiliser applier, ground implements like cultivator, rotovator, puddler etc., and smaller agricultural equipments which can also be called as hand tools like kurpi, hand digger, weeders, scoop, cutter, sickle, saws, secateurs, sheers, clippers, spades, etc.','2021-04-10 07:01:15','2021-04-10 07:01:15',NULL),('4','Agro Shade Nets','1','These nets are made from 100% virgin HDPE and are treated with color master batches and Ultra-violet (UV) stabilizers. These nets are classified by the amount of sunlight that can pass through it. These products are mainly used in applications related to crop protection and agriculture.','2021-04-10 07:06:20','2021-04-10 07:06:20',NULL),('5','Power Sprayers','1','A power sprayer used to apply a highly concentrated pesticide in highly dispersed form usually by delivering it into a strong air blast generated by fans or blowers.','2021-04-10 07:08:39','2021-04-10 07:08:39',NULL),('6','Brushcutter','1','A brushcutter (also called a brush saw or clearing saw) is a powered garden or agricultural tool used to trim weeds, small trees, and other foliage not accessible by a lawn mower or rotary mower. Various blades or trimmer heads can be attached to the machine for specific applications.','2021-04-10 07:10:12','2021-04-10 07:10:12',NULL),('7','Chaff Cutter','1','A chaff cutter is a mechanical device for cutting straw or hay into small pieces before being mixed together with other forage and fed to horses and cattle. This aids the animal\'s digestion and prevents animals from rejecting any part of their food.','2021-04-10 07:31:30','2021-04-10 07:31:30',NULL),('8','Chainsaw','1','A chainsaw (or chain saw[1]) is a portable gasoline-, electric-, or battery-powered saw that cuts with a set of teeth attached to a rotating chain driven along a guide bar. It is used in activities such as tree felling, limbing, bucking, pruning, cutting firebreaks in wildland fire suppression, and harvesting of firewood. Chainsaws with specially designed bar-and-chain combinations have been developed as tools for use in chainsaw art and chainsaw mills.','2021-04-10 07:33:17','2021-04-10 07:33:17',NULL),('9','Drip Irrigation','1','Drip irrigation is a type of micro-irrigation system that has the potential to save water and nutrients by allowing water to drip slowly to the roots of plants, either from above the soil surface or buried below the surface. The goal is to place water directly into the root zone and minimize evaporation.','2021-04-10 07:35:44','2021-04-10 07:35:44',NULL),('10','Mini Tiller','1','Mini tillers are a new type of small agricultural tillers or cultivators used by farmers or homeowners. These are also known as power tillers or garden tillers. Compact, powerful and, most importantly, inexpensive, these agricultural rotary tillers are providing alternatives to four-wheel tractors and in the small farmers\' fields in developing countries are more economical than four-wheel tractors.','2021-04-10 07:37:39','2021-04-10 07:39:49','2021-04-10 07:39:49'),('11','Mini Tiller','1','Mini tillers are a new type of small agricultural tillers or cultivators used by farmers or homeowners. These are also known as power tillers or garden tillers. Compact, powerful and, most importantly, inexpensive, these agricultural rotary tillers are providing alternatives to four-wheel tractors and in the small farmers\' fields in developing countries are more economical than four-wheel tractors.','2021-04-10 07:37:45','2021-04-10 07:37:45',NULL),('12','Mulching Film','1','Mulch films are used to modify soil temperature, limit weed growth, prevent moisture loss, and improve crop yield as well as precocity.','2021-04-10 07:39:32','2021-04-10 07:39:58','2021-04-10 07:39:58'),('13','Mulching Film','1','Mulch films are used to modify soil temperature, limit weed growth, prevent moisture loss, and improve crop yield as well as precocity.','2021-04-10 07:39:37','2021-04-10 07:39:37',NULL),('14','Power Tiller','1','Power Tiller or Heavy Tiller is an innovative machine used for cultivation, tillage, showing and weeding that contains a self-set of blades set up with a powerful engine. Buy Power Tiller is the perfect option to increase farm productivity. \r\n\r\nPower tiller equipment is two-wheeled farm equipment that fitted with a rotary tiller performs smoothly all farm operations. It prepares the soil, plants and sowing seeds, spraying fertilizer. Farm power tiller provides efficient working in paddy and wet fields.','2021-04-10 07:41:36','2021-04-10 07:41:36',NULL),('15','Power Weeder','1','Power Weeders are machines used for removing weeds, stirring and pulverizing the soil and for loosening the soil after the crop begins to grow. Power Weeders are manufactured using high quality raw materials with the help of latest technology. These machines are widely used for weeding cotton, tomato, tapioca, paddy, sugarcane, pulses and various other plant fields.','2021-04-10 07:44:52','2021-04-10 07:44:52',NULL),('16','Pumps','1','A pump is a device that moves fluids (liquids or gases), or sometimes slurries, by mechanical action, typically converted from electrical energy into hydraulic energy. Pumps can be classified into three major groups according to the method they use to move the fluid: direct lift, displacement, and gravity pumps.','2021-04-10 07:47:10','2021-04-10 07:47:10',NULL),('17','Rotavator','1','Rotavators are potent pieces of gardening machinery, often used in allotments and fields, to break up, churn and aerate the soil before planting seeds and bulbs or laying turf. Rotavators uses a set of blades or rotors which twist and break through the soil.','2021-04-10 07:48:49','2021-04-10 07:48:49',NULL),('18','Seedling Trays','1','A seed starting tray is a gardening tool specifically designed to hold multiple seeds, starting from the germination stage, until the seedlings are ready for transplantation. Using such a tray ensures better nutrient availability for each seed, and eliminates the need for multiple plantings.','2021-04-10 07:51:35','2021-04-10 07:51:35',NULL),('19','Seeds Drill','1','A seed drill is a long iron tube having a funnel at the top. The seed drill is tied to back of the plough and seeds are put into the funnel of the seed drill.As the plough makes furrows in the soil,the seed from seed drill are gradually released and sown into the soil.','2021-04-10 07:53:09','2021-04-10 07:53:09',NULL),('20','Starters','1','A motor starter is an electrical device that is used to start & stop a motor safely. Similar to a relay, the motor starter switches the power ON/OFF & unlike a relay, it also provides a low voltage & overcurrent protection.','2021-04-10 07:55:37','2021-04-10 07:55:37',NULL),('21','Tarpaulin','1','A tarpaulin or tarp is a large sheet of strong, flexible, water-resistant or waterproof material, often cloth such as canvas or polyester coated with polyurethane, or made of plastics such as polyethylene. Tarpaulins often have reinforced grommets at the corners and along the sides to form attachment points for rope, allowing them to be tied down or suspended.\r\n\r\nInexpensive modern tarpaulins are made from woven polyethylene; this material is so associated with tarpaulins that it has become colloquially known in some quarters as polytarp.','2021-04-10 07:57:26','2021-04-10 07:57:26',NULL),('22','Transplanter','1','A transplanter is an agricultural machine used for transplanting seedlings to the field. This is very important as it reduces the time taken to transplant seedlings (when compared to manual transplanting), thus allowing more time for harvesting. It also reduces the use of manual energy.','2021-04-10 07:58:31','2021-04-10 07:58:31',NULL),('23','Tree Guard','1','A Tree guard, is a type of plastic shelter used to nurture trees in the early stages of their growth.','2021-04-10 08:00:50','2021-04-10 08:01:08','2021-04-10 08:01:08'),('24','Tree Guard','1','A Tree guard, is a type of plastic shelter used to nurture trees in the early stages of their growth.','2021-04-10 08:00:54','2021-04-10 08:01:05','2021-04-10 08:01:05'),('25','Tree Guard','1','A Tree guard, is a type of plastic shelter used to nurture trees in the early stages of their growth.','2021-04-10 08:00:59','2021-04-10 08:00:59',NULL),('26','Individual Micronutrient','7',NULL,'2021-04-10 08:02:53','2021-04-10 08:02:53',NULL),('27','Micronutrient Mixture','7','Micronutrient Mixture of zinc sulphate, copper sulphate, magnesium sulphate, manganese sulphate, boron, ferrous sulphate and amonium molybdate in perfect percentage and in scientific methrod , micronutrient is essential for all plants specific micro nutrients essential for avoiding and curing the micronutrinet deficiency, all micronutrient element are blended in perfect combination.','2021-04-10 08:21:14','2021-04-10 08:21:14',NULL),('28','Micronutrients Spray','1','Micronutrients Spray foliar spay containing all the essential micronutrients like zinc, ferrous, magnesium , manganese, copper, boron, molybdate , Plant specific micro nutrients essential for avoiding and curing the micronutrinet deficiency, all micronutrient element are blended in perfect combination, chemical micronutrient, micronutrinet powder, micronutrient liquid, micronutrient for foliar spray, micronutrient for foliar application.','2021-04-10 08:22:25','2021-04-10 08:22:25',NULL),('29','Grow Bags','8','A growbag is a large plastic bag filled with a growing medium and used for growing plants, usually tomatoes or other salad crops. The growing medium is usually based on a soilless organic material such as peat, coir, composted green waste, composted bark or composted wood chips, or a mixture of these. Various nutrients are added, sufficient for one season\'s growing, so frequently only planting and watering are required of the end-user. Planting is undertaken by first laying the bag flat on the floor or bench of the growing area, then cutting access holes in the uppermost surface, into which the plants are inserted.','2021-04-10 08:27:00','2021-04-10 08:27:00',NULL),('30','Net Pots','8','Net pots made from premium quality plastic that are 100% virgin plastic. These net pots can be used for all kinds of hydroponic systems.','2021-04-10 08:28:59','2021-04-10 08:28:59',NULL),('31','Nursery Seeds','8',NULL,'2021-04-10 08:30:55','2021-04-10 08:30:55',NULL),('32','Pots & Planters','8',NULL,'2021-04-10 08:32:04','2021-04-10 08:32:12','2021-04-10 08:32:12'),('33','Pots & Planters','8',NULL,'2021-04-10 08:32:07','2021-04-10 08:32:07',NULL),('34','Potting Soil','8','Potting soil, also known as potting mix or miracle soil, is a medium in which to grow plants, herbs and vegetables in a pot or other durable container.','2021-04-10 08:33:22','2021-04-10 08:33:22',NULL),('35','Sprayers','8','A sprayer is a device used to spray a liquid, where sprayers are commonly used for projection of water, weed killers, crop performance materials, pest maintenance chemicals, as well as manufacturing and production line ingredients.','2021-04-10 08:34:56','2021-04-10 08:34:56',NULL),('36','Live Bacteria Series','6',NULL,'2021-04-10 08:36:39','2021-04-10 08:36:39',NULL),('37','Organic Coated Granules','6',NULL,'2021-04-10 08:37:49','2021-04-10 08:37:49',NULL),('38','Organic Neem Products','6',NULL,'2021-04-10 08:38:54','2021-04-10 08:38:54',NULL),('39','Organic PGR Technicals','6',NULL,'2021-04-10 08:39:56','2021-04-10 08:39:56',NULL),('40','Organic Premium PGR','6',NULL,'2021-04-10 08:40:48','2021-04-10 08:40:48',NULL),('41','Organic Stimulant','6',NULL,'2021-04-10 08:41:39','2021-04-10 08:41:39',NULL),('42','Biological Control','2','Biological control or biocontrol is a method of controlling pests such as insects, mites, weeds and plant diseases using other organisms. It relies on predation, parasitism, herbivory, or other natural mechanisms, but typically also involves an active human management role.','2021-04-10 08:44:53','2021-04-10 08:44:53',NULL),('43','HouseHold Insecticides','2','Household insecticides are the chemicals used to destroy or inactivate insects from houses. Household insecticides include the natural and synthetic substances applied to the skin, clothes and the surfaces of houses to control the growth of insects or roaches.','2021-04-10 08:46:43','2021-04-10 08:46:43',NULL),('44','Insecticides','2','Insecticides are substances used to kill insects. They include ovicides and larvicides used against insect eggs and larvae, respectively. Insecticides are used in agriculture, medicine, industry and by consumers.','2021-04-10 08:48:09','2021-04-10 08:48:09',NULL),('45','Fungicides','2','Fungicides are biocidal chemical compounds or biological organisms used to kill parasitic fungi or their spores. A fungistatic inhibits their growth. Fungi can cause serious damage in agriculture, resulting in critical losses of yield, quality, and profit.','2021-04-10 08:49:20','2021-04-10 08:49:20',NULL),('46','Herbicides','2','A herbicide is a pesticide used to kill unwanted plants. Selective herbicides kill certain targets while leaving the desired crop relatively unharmed. Some of these act by interfering with the growth of the weed and are often based on plant hormones.','2021-04-10 08:50:20','2021-04-10 08:50:20',NULL),('47','Biopesticide','2','Biopesticides, a contraction of \'biological pesticides\', include several types of pest management intervention: through predatory, parasitic, or chemical relationships. The term has been associated historically with biological pest control – and by implication, the manipulation of living organisms.','2021-04-10 08:51:51','2021-04-10 08:51:51',NULL),('48','Cotton Seeds','4','Cottonseed is the seed of the cotton plant.','2021-04-10 08:53:29','2021-04-10 08:53:29',NULL),('49','Field Crops Seeds','4','Field crops are grown on a large scale for consumption purposes.','2021-04-10 08:55:52','2021-04-10 08:55:52',NULL),('50','Flower Seeds','4','Flower Seeds are the byproduct of a flower or flower-like structure. Sometimes seeds are encased in fruits, but not always.','2021-04-10 12:16:49','2021-04-10 12:16:49',NULL),('51','Home / kitchen Garden Seeds','4','Kitchen garden is the growing of fruits and vegetables at the backyard of house by using kitchen waste water. Otherwise called as Home garden or Nutrition garden or Kitchen gardening or Vegetable gardening. Advantages of Kitchen garden : Supply fresh fruits and vegetables high in nutritive value.','2021-04-10 12:18:41','2021-04-10 12:18:41',NULL),('52','Other Seeds','4','All other type of seeds.','2021-04-10 12:20:07','2021-04-10 12:20:07',NULL),('53','Vegetable Seeds','4','Edible seeds are also known as legumes. Apart from sweet corn, seeds usually grow in pods which are sometimes eaten along with the seeds. Examples are peas, beans, snow peas (mangetout), sprouted beans and seeds and sweet corn.','2021-04-10 12:22:37','2021-04-10 12:22:37',NULL),('54','Battery Sprayers','5','Battery Powered Disinfectant Sprayer is used to clean and disinfect frequently touched surfaces such as tables, doorknobs, light switches, etc.  These sprayers are also equipped with mopping features and extendable arms to reach hidden areas and clean comprehensively.','2021-04-10 12:26:25','2021-04-10 12:26:25',NULL),('55','Hand Garden Sprayers','5','A sprayer is a device used to spray a liquid, where sprayers are commonly used for projection of water, weed killers, crop performance materials, pest maintenance chemicals, as well as manufacturing and production line ingredients.','2021-04-10 12:27:18','2021-04-10 12:27:18',NULL),('56','Manual Knapsack Sprayers','5','A sprayer is a device used to spray a liquid, where sprayers are commonly used for projection of water, weed killers, crop performance materials, pest maintenance chemicals, as well as manufacturing and production line ingredients.','2021-04-10 12:28:45','2021-04-10 12:29:09',NULL),('57','Petrol Power Sprayers','5','All the sprayers which impart the mechanical energy developed by an I.C. Engine, on the spray fluid before spraying is called as a power sprayer. The most commonly used type of power sprayer in India is a gaseous energy type knapsack sprayer.','2021-04-10 12:30:45','2021-04-10 12:30:45',NULL),('58','Bio Fertilisers','3','Biofertilizers are the substance that contains microbes, which helps in promoting the growth of plants and trees by increasing the supply of essential nutrients to the plants. It comprises living organisms which include mycorrhizal fungi, blue-green algae, and bacteria.','2021-04-10 12:33:02','2021-04-10 12:33:02',NULL),('59','Secondary Fertilisers','3','Sulphur (S), magnesium (Mg) and calcium (Ca) are essential plant nutrients. They are called “secondary” nutrients because plants require them in smaller quantities than nitrogen (N), phosphorus (P), and potassium (K).','2021-04-10 12:34:29','2021-04-10 12:34:29',NULL),('60','new sub category','10',NULL,'2021-05-31 12:09:46','2021-05-31 12:30:09','2021-05-31 12:30:09'),('61','New sub category','1','test sub category','2021-06-02 13:36:58','2021-06-02 13:36:58',NULL),('62','Test Sub Category','1',NULL,'2021-06-03 18:40:51','2021-06-03 18:40:51',NULL);
