INSERT INTO `products` VALUES ('1','Farmers Choice Cow Manure Vermicompost, Organic & Natural Plant Nutrient for Home Gardens Manure, Fertilizer, Potting Mixture, Pesticide  (500 g, Powder)','Farmers choice - Best Gardening Products In India ??Improves soil aeration As the worms move inside the soil, it loosen the soil and increases soil aeration. This provides sufficient space for the plant roots to develop. ??What is Vermicomposting? The process of cultivating earthworms in order to convert organic waste into fertilizer is called Vermicomposting or Vermiculture. This process is done using various species of worms, usually red wigglers, white worms, and other earthworms, to create a mixture of decomposing vegetable or food waste. It feeds on the debris, manure, rotten plant parts etc and ferments it. The worms feed on the organic waste and produce nutrient-rich manure in the form of excreta. The excreta of earthworms are nutritious and hence the soil becomes fertile. They move throughout the soil and loosen the soil. This will allow air circulation to happen inside the soil and the roots get enough space to grow and extend. Farmers choice vermicompost Vermicompost is easy to store and easy to use. (Store it in a shady areas where direct sunlight not coming). Vermicompost is best fertilizer for kitchen garden terrace garden, pot/container plants. Soil moisture storage capacity increases and increases the number of beneficial bacteria. All minor and major element involved which plant required are available in this fertilizer. ??Farmers choice Vermicompost can be used in: Agriculture (organic farming) ,greenhouse,Farmhouse,Fruit orchards,Lawns,Garden plants, Pots and plants, Vegetable kitchen ,gardening,Hanging pots, Nursery plant propagation/grafting/plant production, Terrace garden,Horticulture. ((2% for charity product profit))',NULL,NULL,NULL,'2021-04-06 22:23:04','2021-04-06 22:23:04',NULL,'1'),('3','Taparia 1406 End Cutting Mini Plier (End Cutting)','Taparia 1406 End Cutting Mini Plier is a mini end cutting plier and wire cutter tool.It is ideal for flush cutting soft wire or pulling small nails and brads.Its made up of drop forged carbon steel and is heat treated to ensure durable construction. It contains double leaf springs design , mini wire cutter provides greater cutting power. Plastic coated grips provide extra comfort and reduces hand fatigue.This product is mainly suitable for daily maintenance, industrial and mining, property, etc.It can deal with most of the maintenance requirements.',NULL,NULL,NULL,'2021-04-10 12:42:55','2021-04-10 12:42:55',NULL,'5'),('4','FALCON CAMPAGNOLA PNEUMATIC LOAPER - STAR 50','For those who have to carry out hard operations such as forestry pruning or green areas maintenance, Star 50 is the best Campagnola tool. it is the direct evolution of the previous F/6 U and D models, and its new forged steel blades group is its power point, being a guarantee for strength and hold on the branch. Star 50 can carry out 50 mm cuts and is available in various lengths, up to 3 meters. it is characterized by its “double action”. The blades are operated by compressed air for both the cutting and the blade opening strokes',NULL,NULL,NULL,'2021-04-10 12:51:06','2021-04-10 12:51:06',NULL,'6'),('5','Agro Shade Net - 50% - 30 feet x 10 feet','Agro Shade Net - 50% -   30 feet x 10 feet\r\n\r\nGreen color shade net , Made from virgin material \r\n\r\nHigh Quality , Long lasting , UV stabilized shade net',NULL,NULL,NULL,'2021-04-10 12:54:29','2021-04-10 12:54:29',NULL,'7'),('6','CROMPTON GREAVES - MINI SAFFHIRE 0.5 HP ) Self Priming Pump','CROMPTON GREAVES - MINI SAFFHIRE 0.5 HP ) Self Priming Pump',NULL,NULL,NULL,'2021-04-10 12:57:11','2021-04-10 12:57:11',NULL,'1'),('7','Liv Phosfert - Phosphate Solubilizing Bacteria (PSB)','LivPhosfert is a product of effective phosphate solubilizing microbes which are capable of hydrolysing organic and inorganic phosphorus from insoluble compounds and make it available for the plants. It is associated with the release of low molecular weight organic acids through which they convert insoluble form of phosphate into soluble forms thereby reducing the dependence on chemical fertilizers.',NULL,NULL,NULL,'2021-05-13 10:14:17','2021-05-13 10:15:48',NULL,NULL),('8','LivNPK Team Granules 25kg Bag','LivNPK Team is microbial formulation which is able to synthesize atmospheric nitrogen, solublize phosphate and mobilize potash into available form, thereby supplementing balance nutrition to the crops. It converts non-available forms of some tightly bondes micro nutrients into available form.',NULL,NULL,NULL,'2021-05-13 10:18:38','2021-05-13 10:18:38',NULL,NULL),('9','Sadhan ( Secondary Fertilisers )','The product offer here is 20 Kgs  Pack , delivered to your address',NULL,NULL,NULL,'2021-05-13 10:33:17','2021-05-13 10:33:17',NULL,NULL),('10','2 Stroke power sprayers Agriculture','2 Stroke power sprayers :\r\n\r\n\r\n\r\nSpecification:\r\n\r\nCapable of very high pressure\r\n\r\nFor multiple spray use , two types of spray gun supplied\r\n\r\nSupplied with forced air cooled 2 Stroke petrol Engine\r\n\r\nEquipped with brass metal pump\r\n\r\nDiaphragm type carburetor\r\n\r\nEngine fixed with Easy recoil starter\r\n\r\nLess fuel consumption\r\n\r\nEconomic for spraying costly pesticides\r\n\r\nCleaning output for easy & quick cleaning\r\n\r\nEconomic for spraying costly pesticide\r\n\r\n\r\n\r\nCan be used for spraying pesticide for fruit trees, cotton, and other agriculture and forestry crops\r\n\r\n\r\n\r\nLess fuel consumption\r\n\r\n\r\n\r\nChemical resistant 20 litres tank\r\n\r\n\r\n\r\nFuel tank capacity 0.6 litres\r\n\r\nUse for Agriculture Purpose only',NULL,NULL,NULL,'2021-05-13 10:45:42','2021-05-13 10:45:42',NULL,NULL),('11','4 Stroke power sprayers Agro','4 Stroke power sprayers :\r\n\r\nPremium Quality , Heavy Duty , Long life , Best 4 Stroke power sprayer\r\n\r\nTechnical Details of 4 stroke power sprayer\r\n\r\nEngine : 34CC, 2 Stroke Petrol\r\n\r\nCarburetor : Diaphragm Type\r\n\r\nIgnition System : T.C.I.,\r\n\r\nMax Power (In Kw./RPM) : 0.75 kw/ 8500\r\n\r\nMax Power (In Hp) : 1 Hp\r\n\r\nEngine RPM : 8500\r\n\r\nWorking RPM : 7000\r\n\r\nStart System : Recoil Starter\r\n\r\nFuel Tank Capacity : 700 ml\r\n\r\nUse for Agriculture Purpose only',NULL,NULL,NULL,'2021-05-13 10:47:10','2021-05-13 10:47:10',NULL,NULL),('12','ASPEE Duro-TEKK Agro Sprayer ( 708- AL )','Suitable for row & ground crops like cotton, soybean, vegetables, tea & coffee plantations, orchards & tall trees.\r\n\r\n High density polyethylene tank 20 lit. Capacity with clean out port, adjustable shoulder straps with cushion, 110cm. long high pressure delivery hose, 3 ft. Long  spray gun & straight rod 60 cm, 3 nozzle spray lance supplied with sprayer, forced air cooled 25.6cc petrol engine with reciprocating type brass metal pump & gear box.',NULL,NULL,NULL,'2021-05-13 10:50:12','2021-05-13 10:50:12',NULL,NULL),('13','Agriculture Gardening Disinfectant Hand Sprayer','Agriculture Gardening Hand Sprayer\r\n\r\nMultipurpose Hand Sprayer.Agriculture Gardening Hand Sprayer\r\n\r\nMultipurpose Hand Sprayer.',NULL,NULL,NULL,'2021-05-13 10:53:53','2021-05-13 10:53:53',NULL,NULL),('14','Agriculture Gardening Disinfectant Hand Sprayer 2 Litre','Agriculture Gardening Hand Sprayer',NULL,NULL,NULL,'2021-05-13 10:56:34','2021-05-13 10:56:34',NULL,NULL),('15','CP21 Plantcare Mechanical Continuous Sprayer 450ml (Hooting Jet)','CP21 Plantcare Mechanical Continuous Sprayer 450ml (Hooting Jet)',NULL,NULL,NULL,'2021-05-13 11:01:29','2021-05-13 11:01:29',NULL,NULL),('16','ASPEE V-2007 Knapsack Sprayer','﻿Ideal sprayer for all field crops.\r\n\r\nASPEE V-2007 consists of 16 lit. capacity injection moulded chemical tank, 110 cm long delivery hose, plastic trigger cut-off valve, 60 cm long stainless steel extension rod, flat fan & hollow cone plastic nozzle. Plastic pressure chamber , deep strainer & mechanical agitator fixed with pressure chamber.\r\n\r\nASPEE V-2007 is a manual knapsack agro sprayer , one of the most successful manual knapsack agro sprayer',NULL,NULL,NULL,'2021-05-13 11:04:07','2021-05-13 11:04:07',NULL,NULL),('17','ASPEE GREEN GLORY (GG/16)','ASPEE GREEN GLORY (GG/16)\r\nGREEN GLORY knapsack sprayer is designed for spraying pesticides and weedicides on all types of field crops. 16 lit. plastic injection molded tank fitted with adjustable shoulder straps and suitable for left of right hand operation, tank is provided with bigger filler hole and deep strainer for easy filling.\r\n\r\nTank: H.D.P.E.\r\nTank capacity: 16 ltr\r\nPressure Vessel: H. D. P. E.\r\nSpray lance: Fibre\r\nNormal working pressure (psi): 40\r\nL x W x H (in mm): 400 x 220 x 530\r\nWeight (approx): 4.55 kg',NULL,NULL,NULL,'2021-05-13 11:06:37','2021-05-13 11:06:37',NULL,NULL),('18','Hand Sprayer (16)','Model : FM16\r\n\r\nCapacity: 16 L\r\n\r\nManual: Hand Sprayer',NULL,NULL,NULL,'2021-05-13 11:08:14','2021-05-13 11:08:14',NULL,NULL),('19','2 in 1 Battery Cum Manual Sprayer','Heavy Duty Battery Cum Manual Sprayer\r\n\r\n•    Pressure: 80 psi\r\n\r\n•    Lance: Brass\r\n\r\n•    Charger: 1.7AH\r\n\r\n•    Original Earth Motor.\r\n\r\n•    12V - 8Ah Fresh Original Shengdeli 2.25Kg Battery.\r\n\r\n•    In line filter to prevent nozzle clogging.\r\n\r\n•    Plastic material high quality.\r\n\r\n•    Wide carry straps for easier and more comfortable carrying.\r\n\r\n•    Best price, best service after sales.\r\n\r\n•   Tank Capacity: 16L\r\n\r\n•    6 months warranty (Only on Battery).\r\n\r\n(Any breakage due to rough handling is not covered in guarantee)\r\n\r\nUse for Agriculture Purpose only',NULL,NULL,NULL,'2021-05-13 11:10:26','2021-05-13 11:10:26',NULL,NULL),('20','3 in 1 Battery Sprayer (12x8)','Tank Capacity : 16/18/20L\r\n\r\nPressure : 100PSI\r\n\r\nBattery : 08AH/12AH\r\n\r\nTime after fully charged: 05Hr/ 08Hr\r\n\r\nG.W : 6.5 Kg',NULL,NULL,NULL,'2021-05-13 11:11:53','2021-05-15 12:11:30',NULL,NULL),('21','ASPEE DUO ELECTRO 2 in 1 BATTERY SPRAYER (ADE001/8AHBR)','ASPEE DUO ELECTRO 2 in 1 BATTERY SPRAYER (ADE001/8AHBR)\r\n\r\nDuo Electro Battery Sprayer is provided with 16 ltr capacity High Density Polyethylene tank. It is suitable for large spraying operations in orchards, coffee & plantation.',NULL,NULL,NULL,'2021-05-13 11:13:10','2021-05-13 11:13:10',NULL,NULL),('22','Hybrid Tomato Seeds - F1 Dragon (10GM) (DRAGON01)','It is excellent hybrid variety in oblong segment, fruit color is red, fruit weight is 90 to 120 grm. tolerant to TYLCV, TMV & high temperature.',NULL,NULL,NULL,'2021-05-13 11:18:26','2021-05-13 11:18:26',NULL,NULL),('23','Jindal Brinjal Hybrid (baingan Seeds)-Raina-10GM',NULL,NULL,NULL,NULL,'2021-05-13 11:19:41','2021-05-13 11:19:41',NULL,NULL),('24','Ankur Bhindi -41 Seeds 500 gram','Ankur Bhindi -41 Seeds 500 gram',NULL,NULL,NULL,'2021-05-13 11:20:50','2021-05-13 11:20:50',NULL,NULL),('25','Moringa Seeds - Superior Quality','Moringa Seeds - Superior Quality',NULL,NULL,NULL,'2021-05-13 11:23:44','2021-05-13 11:23:44',NULL,NULL),('26','Jindal Spinach Seeds(Palak Seeds) Saurabh -500GM','Jindal Spinach Seeds / Palak Seeds Saurabh \r\n\r\nLeaf colour: fresh dark green. Steam colour: green.\r\nMulti-cut: 2-3 time. Plant habit: Eract& vigerous.\r\nDuration: 30-35 days.\r\n\r\nWeight:500GM',NULL,NULL,NULL,'2021-05-13 11:28:03','2021-05-13 11:28:03',NULL,NULL),('27','Complete Home Garden Kit','Complete home garden kit contains \r\n1-Seeds  (Bhindi, chilli,clusterbean,spinach,methi,bottlegourd,tomato)\r\n\r\n2-Magnesium sulphate (500g)\r\n\r\nIt\'s a Combo Pack containing Seeds and Magnesium Sulphate . \r\n\r\nBest for Home Kitchen Garden',NULL,NULL,NULL,'2021-05-13 11:57:56','2021-05-13 11:57:56',NULL,NULL),('28','Jindal Chilli Hybrid Seeds(mirch Seeds)-Arya-10GM','Jindal Chilli Hybrid Seeds(mirch Seeds)-Arya-10GM\r\n\r\nYellowish green & dark red in ripe. Smooth fruit surface.\r\nvary high pungency. 14-16 cm length & 1.2-1.5 cm \r\ndiameter. Good for fresh market.\r\n\r\nWeight: 10GM',NULL,NULL,NULL,'2021-05-13 12:03:47','2021-05-13 12:03:47',NULL,NULL),('29','Corn Flower Seed','GROWING METHOD OF CORNFLOWER:\r\nCornflower is grown by direct seed sowing in pots.\r\nSowing can be done in June-July in low rainfall regions and September-October for winter flowering.\r\nThe garden soil should be well prepared and formed evenly. Soil should be aerated, porous with good drainage.\r\nBefore sowing the seeds, soil should be made slightly moist.\r\nFor beds and borders, seeds can be broadcasted directly and evenly on the soil, and extra seedlings can be thinned later.\r\nImmediately after sowing the seeds, water carefully with a fine rose-can.\r\n\r\n\r\nPlanting Distance: 20-25 cm spacing allowed. The plant can be grown in a 10-inch pot.\r\n\r\nWatering: Regular light watering is recommended.\r\n\r\nFeeding: Fresh compost should be added to soil at the time of planting is given every 15 days along with vermicompost.\r\n\r\nPlant care: It is a hardy plant that does not attract many diseases. Allow the plant to grow freely in open sunny locations.\r\n\r\nBloom time: The plant flowers in 3 to 3.5 months.\r\n\r\nDeadheading: It is advisable to remove the faded for a prolonged flowering period.',NULL,NULL,NULL,'2021-05-13 12:08:56','2021-05-13 12:08:56',NULL,NULL),('30','Cabbage Ornamental Flower Seeds','PLANT HEIGHT : Grows Up To 1.5 Feet High\r\n\r\nFLOWER SHAPE: Fringed, Ruffled Leaves\r\n\r\nCOLOUR : Pink, Purple And White With Green Edges\r\n\r\nSPECIFICATIONS : Edible Leaves, Suitable For Salad Dressings',NULL,NULL,NULL,'2021-05-13 12:10:18','2021-05-13 12:10:18',NULL,NULL),('31','Carnation Flower Seeds','Growing Carnations\r\nCarnations grow readily from cuttings made from the suckers that form around the base of the stem, the side shoots of the flowering stem, or the main shoots before they show flower-buds.\r\nThe cuttings from the base make the best plants in most cases.\r\nThese cuttings may be taken from a plant at any time through fall or winter, rooted in sand and potted up.\r\nThey may be put in pots until the planting out time in spring, which is usually in April or in any time when the ground is ready to be handled.\r\nThe soil should be deep, friable and sandy loam.',NULL,NULL,NULL,'2021-05-13 12:11:29','2021-05-13 12:11:29',NULL,NULL),('32','Shree Moong - Green Gram Seeds','Shree Moong Green Gram seeds , the variety is Kopergaon which is mostly preferred during kharif season .\r\n\r\nThis is one of the height yielding variety of Moon ( Green Gram )\r\n\r\nThe product offer here is 1 Kg  Pack , delivered to your address .',NULL,NULL,NULL,'2021-05-13 12:14:44','2021-05-13 12:14:44',NULL,NULL),('33','Bengal Gram (Chana) - Seeds VIJAY','Crop     : Bengal Gram (Chana)\r\n\r\nVariety  : Vijay \r\n\r\nMaturity : 105-110 days\r\n\r\nFeatures : Resistant to Wilt , \r\n\r\n	   Tolerant to terminal moisture stress\r\n\r\nPacking available : 10 Kg',NULL,NULL,NULL,'2021-05-13 12:16:39','2021-05-13 12:16:39',NULL,NULL),('34','Shree Udid Seeds ( Black Gram ) - TAU 1','Shree Udid Seeds ( Black Gram ) - TAU 1\r\n\r\nTAU 1 - Udid Black gram \r\n\r\nTAU1 is one of the most popular and successful variety of UDID or black gram . \r\n\r\nIts Duration is about 68-75 days\r\n\r\nGrain : Bold & Oval shape\r\n\r\nColor : Purplish black\r\n\r\nModerately resistant to powdery mildew\r\n\r\nOne of the most highest yielding variety \r\n\r\nThe product offer here is 1 Kg  Pack , delivered to your address .',NULL,NULL,NULL,'2021-05-13 12:18:39','2021-05-13 12:18:39',NULL,NULL),('35','ASPEE CHAIN SAW (CYBT-52)','ASPEE CHAIN SAW (CYBT-52)\r\n\r\nAspee Chain Saw is compact equipment with 52 cc two stroke petrol engine. It is endowed with a top powered engine in its category, having high speed steel chain cutter, chain brake system is provided to stop chain is kickback occurs.\r\n\r\nModel: CYBT/52\r\nEngine Type: 2 - Stroke forced air cooled petrol engine\r\nDisplacement: 52 cc\r\nMax. Output Power: 1.46 kw / 8500 rpm / 3 hp\r\nIgnition System: C. D. I.\r\nStarting System: Recoil Starter\r\nCarburetor: Diaphragm\r\nFuel Tank Capacity: 550 ml\r\nOil Tank Capacity: 250 ml\r\nBar Length: 18” / 20 “ / 22”\r\nWeight: 8.5 kgs\r\nDimension (cm): 48 x 26 x 29',NULL,NULL,NULL,'2021-05-13 12:29:30','2021-05-13 12:29:30',NULL,NULL),('36','Epsom Salt','helps seeds germinate, makes plants grow bushier, produces more flowers, increases chlorophyll production and deters pests, such as slugs and voles. It also provides vital nutrients to supplement your regular fertilizer. ... “Magnesium and sulfur are essential nutrients',NULL,NULL,NULL,'2021-05-13 12:32:10','2021-05-13 12:32:10',NULL,NULL),('37','Ammonium molybdate micronutrient','Ammonium molybdate is an odourless crystalline compound. It is used as an analytical reagent to measure the amount of phosphates, silicates, arsenates and lead in aqueous solution.\r\nIt is also used in the production of molybdenum metal and ceramics, in the preparation of dehydrogenation and desulphurization catalysts, in the fixing of metals, in electroplating, in fertilizers for crops and also as a negative stain in biological electron microscopy.\r\n\r\nThe product offer here is 500 ml  Pack , delivered to your address .\r\nUse for Agriculture Purpose only',NULL,NULL,NULL,'2021-05-13 12:34:00','2021-05-13 12:34:00',NULL,NULL),('38','Agrophos - Micronitrient Mixture - 10 Kg','Agrophos -  Micronitrient Mixture for Soil Application\r\n\r\nIt contains all the micronutrient element Magnesium, Zinc,Copper,Boron,Manganese,Ferrous,Molybdate in perfect blend.\r\n\r\nAgrophos is a micronutrient powder that constitutes essential micro nutrients such as zinc, iron, copper, boron and molybdenum that are also essential plant nutrients. The fertilizer is basically a well balanced micro nutrient mixture in powder form, which is formulated exclusively for meeting the requirement of various types of horticulture and plantation crops.\r\n\r\nIt removes the micronutrient deficiency of plants \r\n\r\nUse for Agriculture Purpose only',NULL,NULL,NULL,'2021-05-13 12:36:27','2021-05-13 12:36:27',NULL,NULL),('39','Microhume','Microhume is a multi micronutrients fertilizer enhanced with Humic Acid for foliar application.',NULL,NULL,NULL,'2021-05-13 12:37:57','2021-05-13 12:37:57',NULL,NULL),('40','Cotmax - Micronutrient spray for Cotton','Cotmax - Micronutrient spray for Cotton Crop\r\n\r\nCotmax : A perfect blend of all micronutrient in right proportions .\r\n\r\nIts a foliar spray , Plants are capable of taking in nourishment through their leaves as well as their roots. Foliar sprays work quickly to give your plants the micronutrients they need, and maybe just in time. \r\n\r\nMicronutrients are essential for plant growth and play an important role in balanced crop nutrition. They include boron (B), copper (Cu), iron (Fe), manganese (Mn), molybdenum (Mo), zinc (Zn), nickel (Ni) and chloride (Cl). They are as important to plant nutrition as primary and secondary macronutrients, though plants don\'t require as much of them. A lack of any one of the micronutrients in the soil can limit growth, even when all other nutrients are present in adequate amounts.\r\n\r\nMicronutrients are those nutritional elements, which are required in the micro-quantities to the crops. They are, just as important to the plants’ growth & development and profitable crop production, as the major nutrients especially they work “behind the scene” as activators of many plant functions. In the modern agriculture , intensive cropping-system is widely adopted by the farmers combining with the imbalance usage of fertilizers particularly micro-nutrients based fertilizers ,due to which, the soil has become sick and micro-nutritionally deficient, which in turns, reducing the crop yield in terms of quantity and quality. In the recent years deficiencies of micro-nutrients have been diagnosed more frequently on crops in several areas. Many farmers are taking closer look towards this problems and have started the balance usage of micro-nutrients in soil for the maximization of crop yield and quality.\r\n\r\nThe product offer here is 500 ml  Pack , delivered to your address .\r\n\r\nUse for Agriculture Purpose only',NULL,NULL,NULL,'2021-05-13 12:39:18','2021-05-13 12:39:18',NULL,NULL),('41','Blue Sticky Trap ( 6x8 Inch ) Pack of 50','Blue Sticky Trap ( 6x8 Inch ) Pack of 50',NULL,NULL,NULL,'2021-05-13 12:43:07','2021-05-13 12:43:07',NULL,NULL),('42','Anti termite Wood Protector Liquid | Anti Termite Spray','Anti termite Wood Protector Liquid ,\r\n\r\nContain Chlorpyriphos , ready to use \r\n\r\nYou can Use it directly without mixing with water or kerosene .\r\n\r\nExcellent results for Termite Control .\r\n\r\nIt is the best termite killer spray nebulized on wooden surfaces. This is the cheapest chemical and most effective for control of Termites .',NULL,NULL,NULL,'2021-05-13 12:44:44','2021-05-13 12:44:44',NULL,NULL),('43','Actrex-Thiamethoxam 25 WG Insecticide Agro','Actrax - Thiamethoxam 25% WG\r\n\r\nThiamethoxam 25% WG. It is a broad spectrum systemic insecticides which has quick stomach as well contact activity. Offered product is recommended for applications to control gall midge, stem borer, leaf folder, white backed plant hopper and brown plant Hopper in rice and jassid, aphid and white flies in vegetables, cotton and Mustard. Owing to its high effectiveness, it is also used to control bugs in the tea plantation.\r\n\r\n \r\n\r\nSalient Features of Thiamethoxam 25% WG :\r\n\r\n \r\n\r\nBiodegradable in nature, hence safe for environment\r\nEasy to transport\r\nVery easy to use\r\nHas quick stomach as well as contact action\r\nEffective for broad range of insect as well as for various crops\r\n\r\n\r\nSpecifications of Thiamethoxam 25% WG :\r\n\r\n\r\n\r\nContains Thiamethoxam 25% as active ingredient\r\nThe product offer here is 250 gms  Pack , delivered to your address .\r\n\r\nUse for Agriculture Purpose only',NULL,NULL,NULL,'2021-05-13 12:46:21','2021-05-13 12:46:21',NULL,NULL),('44','Bayer Antracol fungicide with broad spectrum 250g','Antracol contains Propineb, a contact fungicide with broad spectrum activity against various diseases of rice, chilli, grapes, potato and other vegetables and fruits. Propineb is a polymeric zinc-containing dithiocarbamate. Due to the release of zinc, the application of Antracol results in greening effect on the crop and subsequent improvement in quality of produce.',NULL,NULL,NULL,'2021-05-13 12:48:21','2021-05-13 12:48:21',NULL,NULL),('45','Atrazoom - ( Atrazine 50 WP) Selective Herbicide',NULL,NULL,NULL,NULL,'2021-05-13 12:49:52','2021-05-13 12:49:52',NULL,NULL),('48','Test','a',NULL,NULL,NULL,'2021-05-15 11:41:55','2021-05-15 11:42:12','2021-05-15 11:42:12',NULL),('49','Atrazoom - ( Atrazine 50 WP) Selective Herbicide',NULL,NULL,NULL,NULL,'2021-05-29 08:05:48','2021-05-29 08:06:13','2021-05-29 08:06:13','4'),('50','Test Product','test',NULL,NULL,NULL,'2021-05-31 12:15:13','2021-05-31 12:29:33','2021-05-31 12:29:33','9'),('51','New Product','Description',NULL,NULL,NULL,'2021-06-02 13:42:54','2021-06-02 13:42:54',NULL,'1'),('52','Test new peoduct',NULL,NULL,NULL,NULL,'2021-06-02 13:47:12','2021-06-02 13:47:12',NULL,NULL),('53','New Product','description',NULL,NULL,NULL,'2021-06-07 11:09:59','2021-06-07 11:09:59',NULL,'1'),('54','fgsdgsdfg','gfdfgsdfgsdf',NULL,NULL,NULL,'2021-08-10 16:45:04','2021-08-10 16:45:04',NULL,'1');
