", \"We\", \"Us\" or \"Our\" in this Agreement) refers to KV PRO PRIVATE LIMITED, Creatrix Health Private Limited, 2nd Floor, Satish Tower, Above Kamla Medicose, Near Gharhi Chowk, Supela, Bhilai Nagar, 490023.</p><p>&nbsp;</p><p>Cookies are small files that are placed on Your computer, mobile device or any other device by a website, containing the details of Your browsing history on that website among its many uses.</p><p>&nbsp;</p><p>Country refers to: Chhattisgarh, India</p><p>&nbsp;</p><p>Device means any device that can access the Service such as a computer, a cellphone or a digital tablet.</p><p>&nbsp;</p><p>Personal Data is any information that relates to an identified or identifiable individual.</p><p>&nbsp;</p><p>Service refers to the Website.</p><p>&nbsp;</p><p>Service Provider means any natural or legal person who processes the data on behalf of the Company. It refers to third-party companies or individuals employed by the Company to facilitate the Service, to provide the Service on behalf of the Company, to perform services related to the Service or to assist the Company in analyzing how the Service is used.</p><p>&nbsp;</p><p>Usage Data refers to data collected automatically, either generated by the use of the Service or from the Service infrastructure itself (for example, the duration of a page visit).</p><p>&nbsp;</p><p>Website refers to Krishak Vikash, accessible from https://krishakvikas.com</p><p>&nbsp;</p><p>You means the individual accessing or using the Service, or the company, or other legal entity on behalf of which such individual is accessing or using the Service, as applicable.</p><p>&nbsp;</p><p>Collecting and Using Your Personal Data</p><p>Types of Data Collected</p><p>Personal Data</p><p>While using Our Service, We may ask You to provide Us with certain personally identifiable information that can be used to contact or identify You. Personally identifiable information may include, but is not limited to:</p><p>&nbsp;</p><p>Email address</p><p>&nbsp;</p><p>First name and last name</p><p>&nbsp;</p><p>Phone number</p><p>&nbsp;</p><p>Address, State, Province, ZIP/Postal code, City</p><p>&nbsp;</p><p>Usage Data</p><p>&nbsp;</p><p>Usage Data</p><p>Usage Data is collected automatically when using the Service.</p><p>&nbsp;</p><p>Usage Data may include information such as Your Device\'s Internet Protocol address (e.g. IP address), browser type, browser version, the pages of our Service that You visit, the time and date of Your visit, the time spent on those pages, unique device identifiers and other diagnostic data.</p><p>&nbsp;</p><p>When You access the Service by or through a mobile device, We may collect certain information automatically, including, but not limited to, the type of mobile device You use, Your mobile device unique ID, the IP address of Your mobile device, Your mobile operating system, the type of mobile Internet browser You use, unique device identifiers and other diagnostic data.</p><p>&nbsp;</p><p>We may also collect information that Your browser sends whenever You visit our Service or when You access the Service by or through a mobile device.</p><p>&nbsp;</p><p>Tracking Technologies and Cookies</p><p>We use Cookies and similar tracking technologies to track the activity on Our Service and store certain information. Tracking technologies used are beacons, tags, and scripts to collect and track information and to improve and analyze Our Service. The technologies We use may include:</p><p>&nbsp;</p><p>Cookies or Browser Cookies. A cookie is a small file placed on Your Device. You can instruct Your browser to refuse all Cookies or to indicate when a Cookie is being sent. However, if You do not accept Cookies, You may not be able to use some parts of our Service. Unless you have adjusted Your browser setting so that it will refuse Cookies, our Service may use Cookies.</p><p>Flash Cookies. Certain features of our Service may use local stored objects (or Flash Cookies) to collect and store information about Your preferences or Your activity on our Service. Flash Cookies are not managed by the same browser settings as those used for Browser Cookies. For more information on how You can delete Flash Cookies, please read \"Where can I change the settings for disabling, or deleting local shared objects?\" available at https://helpx.adobe.com/flash-player/kb/disable-local-shared-objects-flash.html#main_Where_can_I_change_the_settings_for_disabling__or_deleting_local_shared_objects_</p><p>Web Beacons. Certain sections of our Service and our emails may contain small electronic files known as web beacons (also referred to as clear gifs, pixel tags, and single-pixel gifs) that permit the Company, for example, to count users who have visited those pages or opened an email and for other related website statistics (for example, recording the popularity of a certain section and verifying system and server integrity).</p><p>Cookies can be \"Persistent\" or \"Session\" Cookies. Persistent Cookies remain on Your personal computer or mobile device when You go offline, while Session Cookies are deleted as soon as You close Your web browser. Learn more about cookies: Cookies: What Do They Do?.</p><p>&nbsp;</p><p>We use both Session and Persistent Cookies for the purposes set out below:</p><p>&nbsp;</p><p>Necessary / Essential Cookies</p><p>&nbsp;</p><p>Type: Session Cookies</p><p>&nbsp;</p><p>Administered by: Us</p><p>&nbsp;</p><p>Purpose: These Cookies are essential to provide You with services available through the Website and to enable You to use some of its features. They help to authenticate users and prevent fraudulent use of user accounts. Without these Cookies, the services that You have asked for cannot be provided, and We only use these Cookies to provide You with those services.</p><p>&nbsp;</p><p>Cookies Policy / Notice Acceptance Cookies</p><p>&nbsp;</p><p>Type: Persistent Cookies</p><p>&nbsp;</p><p>Administered by: Us</p><p>&nbsp;</p><p>Purpose: These Cookies identify if users have accepted the use of cookies on the Website.</p><p>&nbsp;</p><p>Functionality Cookies</p><p>&nbsp;</p><p>Type: Persistent Cookies</p><p>&nbsp;</p><p>Administered by: Us</p><p>&nbsp;</p><p>Purpose: These Cookies allow us to remember choices You make when You use the Website, such as remembering your login details or language preference. The purpose of these Cookies is to provide You with a more personal experience and to avoid You having to re-enter your preferences every time You use the Website.</p><p>&nbsp;</p><p>For more information about the cookies we use and your choices regarding cookies, please visit our Cookies Policy or the Cookies section of our Privacy Policy.</p><p>&nbsp;</p><p>Use of Your Personal Data</p><p>The Company may use Personal Data for the following purposes:</p><p>&nbsp;</p><p>To provide and maintain our Service, including to monitor the usage of our Service.</p><p>&nbsp;</p><p>To manage Your Account: to manage Your registration as a user of the Service. The Personal Data You provide can give You access to different functionalities of the Service that are available to You as a registered user.</p><p>&nbsp;</p><p>For the performance of a contract: the development, compliance and undertaking of the purchase contract for the products, items or services You have purchased or of any other contract with Us through the Service.</p><p>&nbsp;</p><p>To contact You: To contact You by email, telephone calls, SMS, or other equivalent forms of electronic communication, such as a mobile application\'s push notifications regarding updates or informative communications related to the functionalities, products or contracted services, including the security updates, when necessary or reasonable for their implementation.</p><p>&nbsp;</p><p>To provide You with news, special offers and general information about other goods, services and events which we offer that are similar to those that you have already purchased or enquired about unless You have opted not to receive such information.</p><p>&nbsp;</p><p>To manage Your requests: To attend and manage Your requests to Us.</p><p>&nbsp;</p><p>For business transfers: We may use Your information to evaluate or conduct a merger, divestiture, restructuring, reorganization, dissolution, or other sale or transfer of some or all of Our assets, whether as a going concern or as part of bankruptcy, liquidation, or similar proceeding, in which Personal Data held by Us about our Service users is among the assets transferred.</p><p>&nbsp;</p><p>For other purposes: We may use Your information for other purposes, such as data analysis, identifying usage trends, determining the effectiveness of our promotional campaigns and to evaluate and improve our Service, products, services, marketing and your experience.</p><p>&nbsp;</p><p>We may share Your personal information in the following situations:</p><p>&nbsp;</p><p>With Service Providers: We may share Your personal information with Service Providers to monitor and analyze the use of our Service, to contact You.</p><p>For business transfers: We may share or transfer Your personal information in connection with, or during negotiations of, any merger, sale of Company assets, financing, or acquisition of all or a portion of Our business to another company.</p><p>With Affiliates: We may share Your information with Our affiliates, in which case we will require those affiliates to honor this Privacy Policy. Affiliates include Our parent company and any other subsidiaries, joint venture partners or other companies that We control or that are under common control with Us.</p><p>With business partners: We may share Your information with Our business partners to offer You certain products, services or promotions.</p><p>With other users: when You share personal information or otherwise interact in the public areas with other users, such information may be viewed by all users and may be publicly distributed outside.</p><p>With Your consent: We may disclose Your personal information for any other purpose with Your consent.</p><p>Retention of Your Personal Data</p><p>The Company will retain Your Personal Data only for as long as is necessary for the purposes set out in this Privacy Policy. We will retain and use Your Personal Data to the extent necessary to comply with our legal obligations (for example, if we are required to retain your data to comply with applicable laws), resolve disputes, and enforce our legal agreements and policies.</p><p>&nbsp;</p><p>The Company will also retain Usage Data for internal analysis purposes. Usage Data is generally retained for a shorter period of time, except when this data is used to strengthen the security or to improve the functionality of Our Service, or We are legally obligated to retain this data for longer time periods.</p><p>&nbsp;</p><p>Transfer of Your Personal Data</p><p>Your information, including Personal Data, is processed at the Company\'s operating offices and in any other places where the parties involved in the processing are located. It means that this information may be transferred to — and maintained on — computers located outside of Your state, province, country or other governmental jurisdiction where the data protection laws may differ than those from Your jurisdiction.</p><p>&nbsp;</p><p>Your consent to this Privacy Policy followed by Your submission of such information represents Your agreement to that transfer.</p><p>&nbsp;</p><p>The Company will take all steps reasonably necessary to ensure that Your data is treated securely and in accordance with this Privacy Policy and no transfer of Your Personal Data will take place to an organization or a country unless there are adequate controls in place including the security of Your data and other personal information.</p><p>&nbsp;</p><p>Disclosure of Your Personal Data</p><p>Business Transactions</p><p>If the Company is involved in a merger, acquisition or asset sale, Your Personal Data may be transferred. We will provide notice before Your Personal Data is transferred and becomes subject to a different Privacy Policy.</p><p>&nbsp;</p><p>Law enforcement</p><p>Under certain circumstances, the Company may be required to disclose Your Personal Data if required to do so by law or in response to valid requests by public authorities (e.g. a court or a government agency).</p><p>&nbsp;</p><p>Other legal requirements</p><p>The Company may disclose Your Personal Data in the good faith belief that such action is necessary to:</p><p>&nbsp;</p><p>Comply with a legal obligation</p><p>Protect and defend the rights or property of the Company</p><p>Prevent or investigate possible wrongdoing in connection with the Service</p><p>Protect the personal safety of Users of the Service or the public</p><p>Protect against legal liability</p><p>Security of Your Personal Data</p><p>The security of Your Personal Data is important to Us, but remember that no method of transmission over the Internet, or method of electronic storage is 100% secure. While We strive to use commercially acceptable means to protect Your Personal Data, We cannot guarantee its absolute security.</p><p>&nbsp;</p><p>Children\'s Privacy</p><p>Our Service does not address anyone under the age of 13. We do not knowingly collect personally identifiable information from anyone under the age of 13. If You are a parent or guardian and You are aware that Your child has provided Us with Personal Data, please contact Us. If We become aware that We have collected Personal Data from anyone under the age of 13 without verification of parental consent, We take steps to remove that information from Our servers.</p><p>&nbsp;</p><p>If We need to rely on consent as a legal basis for processing Your information and Your country requires consent from a parent, We may require Your parent\'s consent before We collect and use that information.</p><p>&nbsp;</p><p>Links to Other Websites</p><p>Our Service may contain links to other websites that are not operated by Us. If You click on a third party link, You will be directed to that third party\'s site. We strongly advise You to review the Privacy Policy of every site You visit.</p><p>&nbsp;</p><p>We have no control over and assume no responsibility for the content, privacy policies or practices of any third party sites or services.</p><p>&nbsp;</p><p>Changes to this Privacy Policy</p><p>We may update Our Privacy Policy from time to time. We will notify You of any changes by posting the new Privacy Policy on this page.</p><p>&nbsp;</p><p>We will let You know via email and/or a prominent notice on Our Service, prior to the change becoming effective and update the \"Last updated\" date at the top of this Privacy Policy.</p><p>&nbsp;</p><p>You are advised to review this Privacy Policy periodically for any changes. Changes to this Privacy Policy are effective when they are posted on this page.</p><p>&nbsp;</p><p>Contact Us</p><p>If you have any questions about this Privacy Policy, You can contact us:</p><p>&nbsp;</p><p>By visiting this page on our website: https://krishakvikas.com/contact</p>','2021-05-16 12:56:25','2021-05-16 12:56:25');
